const TabelPengunjung = (props) => {
    const {data} = props;


    return (
        <div>
            <thead>
                <td>Nama</td>
                <td>Umur</td>
                <td>Jenis Kelamin</td>
                <td>Aksi</td>
            </thead>

            <tbody>
                    {data.map((item) => 
                <tr>
                        <td>{item.nama}</td>
                        <td>{item.umur}</td>
                        <td>{item.jenisKelamin}</td>
                </tr>
                    )}
            </tbody>
        </div>
    )
}

export default TabelPengunjung;
